tmso-tstyle-colband-size:0;\\n\\tmso-style-noshow:yes;\\n\\tmso-style-priority:99;\\n\\tmso-style-parent:\\\"\\\";\\n\\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\\n\\tmso-para-margin-top:0in;\\n\\tmso-para-margin-right:0in;\\n\\tmso-para-margin-bottom:8.0pt;\\n\\tmso-para-margin-left:0in;\\n\\tline-height:107%;\\n\\tmso-pagination:widow-orphan;\\n\\tfont-size:11.0pt;\\n\\tfont-family:Calibri;\\n\\tmso-ascii-font-family:Calibri;\\n\\tmso-ascii-theme-font:minor-latin;\\n\\tmso-hansi-font-family:Calibri;\\n\\tmso-hansi-theme-font:minor-latin;}\\n</style>\\n<![endif]--> <!--StartFragment--></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><strong><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">ASSET VALUATION:<span style=\\\"mso-tab-count: 1;\\\">&nbsp;&nbsp;&nbsp; </span></span></strong></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">These reports are provided as an accommodation to enable you to monitor your investment activity. Your quarterly report reects all activity generated during the quarter. It may not match your custodian's statement as some custodians generate their statements before all month end dividends have been posted to the account. We urge you to compare our report with the account statement from your custodian. Please notify us if you are not receiving account statements directly from your custodian. The information for this review has been derived from sources believed to be factual and reliable. No representation or warranty is made or implied about its accuracy or completeness. Past performance does not guarantee future performance. Further, the principal value of investments may uctuate and may be worth more or less than its original cost. </span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">If we have not been provided with the original cost&shy; basis or purchase &shy;price information for one or more of your assets, we would be happy to add this information and update your valuation reports, once we receive this missing cost&shy; basis data from you or your tax advisor. If you have any questions about your report or your portfolio account, please contact our home oce at your convenience. </span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman';\\\">&nbsp;</span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><strong><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">TAXES: </span></strong></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">Nothing herein should be construed as tax advice, and you are urged to consult with your tax advisor when ling your taxes. </span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman';\\\">&nbsp;</span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><strong><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">UNSUPERVISED ASSETS:</span></strong></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">Non&shy;-managed assets are reported as a courtesy to our clients. We rely on third pares to report the values of unsupervised assets to us. Sometimes current prices are not available, particularly with respect to non-&shy;publicly traded securities. In such cases, the current value is calculated using the last known price per share, which could be the original purchase price or &ldquo;book&rdquo; cost. The actual value of unsupervised and non&shy;-managed securities may di␀er from the quotes we obtain or are given, and any prices or valuations listed in our reports are provided only as a general guide and not a guarantee of accuracy. </span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman';\\\">&nbsp;</span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><strong><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">INVESTMENT OBJECTIVES:</span></strong></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman'; color: black;\\\">Please remember to contact your advisor if there are any changes in your nancial situation or investment objectives, or if you wish to impose, add to, or modify any conditions regarding our investment management services. (Note however that any requests to change the conditions of our investment management services must rst be acknowledged and agreed to in wring by us.) </span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; line-height: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: Arial; mso-fareast-font-family: 'Times New Roman';\\\">&nbsp;</span></p>\\n<p class=\\\"MsoNorma